import React, { useEffect } from "react";
import { HealmeLogo } from "../../../constants/constants";
import { DocPic } from "../../../constants/constants";
import './_ViewAppointment.css';
import Cookies from "js-cookie";
import axios from "axios";

const View_appointment:React.FC = () => {

    const handleDoctorButtonClick = () => {
        Cookies.set('docselect','admin');
        window.location.href = '/doctor-select/select-timing'; // place whatever site you want to navigate to 
      };
      const detail ={
        'patname':Cookies.get()
      }
       axios.post('/fetchappointment', detail)
      .then(response => {
        if (response.data.message === '1') {
          return false;
        } else {
          return true;
        }
      })
      .catch(error => {
        console.error('Error sending data to Flask akshay:', error);
        return false;
      });
  
    return (
        <div className="home-page-container">
            <div className="header-container">
                <div className="logo-container">
                    <img className="logo-img" src={ HealmeLogo } alt="Logo" />
                </div>
            </div>
            <div>
                listing {Cookies.get('doctype')}
            </div>
            <div className="body-container" id='list'>
                <div className="doctor-confirm-panel" >
                    <div className="doc-photo">
                         <img className="doc" src= { DocPic } alt="Pic of the doctor" />
                    </div>
                    <div className="appointment-description">
                        <div>
                            Dr. Anita Priyamouli
                        </div>
                        <div>  
                            Consultant - Dental Surgery BDS 
                        </div>
                    </div>
                    <button type="button" className="doctor-btn" onClick={handleDoctorButtonClick}>
                        Book An Appointment
                    </button>
                </div>
                
            </div>
            {/* <div className="bottom-border">
            </div>
            <div className="copyrights-text">Â©HEALME TECHNOLOGIES</div> */}
        </div>
    )
}

export default View_appointment;
